import * as actionTypes from './actionTypes';

export const addList = (name) =>{
    return {
        type: actionTypes.ADD_LIST,
        ingredientName: name
    };
};

export const removeList = (name) =>{
    return {
        type: actionTypes.REMOVE_LIST,
        ingredientName: name
    };
};
